 function ct() {
  return ['<p>  Use pinch-to-zoom with your fingers to zoom in on the playing area. Check it out! (internet access needed) </p> <video style="position:relative; background-color: green; left: 400px; width: 889px; height: 500px; margin-top: -15px; margin-bottom: -30px; display: block" width=665 height=500 preload="auto" poster="https://raw.githubusercontent.com/agamemnus/safari-jigsaw-free/gh-pages/tutorial/pinch-to-zoom.jpg" controls><source type="video/mp4" src="https://raw.githubusercontent.com/agamemnus/safari-jigsaw-free/gh-pages/tutorial/pinch-to-zoom.mp4"></video>', '<p> This game is designed to operate on a wide range of Android-powered devices, so the default resolution is reduced. You can increase the clarity of your images if your phone or tablet has enough RAM to handle it: simply select the menu icon (the three horizontal bars on the left), then "Misc. Config", and finally toggle "Reduce Texture Size" until it is set to "Off". (Note that this doesn\'t take effect while you are inside a puzzle screen!) </p>', '<p> You can play this game on your PC or Mac, too! <a href="http://www.safarijigsaw.com">http://www.safarijigsaw.com</a> (Currently only tested on the latest Chrome browser.) </p>', '<p> "Tell A Friend" is a ghost town. I guess no one wants to tell their email addressbook friends. Would you tell your Facebook friends? Any other ideas? Email <a href="info@flyingsoftgames.com">info@flyingsoftgames.com</a> with your ideas, and you will be manually credited 5-10 gems! </p>', "<p> You can change a wide range of sound, video, and miscellaneous game settings in the configuration menu. </p>", "<p> A watched pot never boils... well, that's technically wrong, and you should really watch out for flare-ups and too-curious pets. Please jigsaw responsibly. </p>", '<p> You can review all the gameplay tips in "How to Play" from the menu button. </p>', "<p> It might take a while to close the game after you press the back key, because the game saves your gameplay data to my server right before it closes, and this might take a few seconds if you have a lot of data to save. I am working on dramatically improving the speed of this system! Your game data is also stored in your device -- the server system functions as a backup. </p>", '<p> This game comes with 5 different built-in soundtracks, 3 African-themed and 2 "relaxation" themed. Know of particularly suitable free-to-use music that you\'d like to mention? Email <a href="info@flyingsoftgames.com">info@flyingsoftgames.com</a> with the details, and receive 5-10 gems! </p>', '<p> This game is under continual (usually weekly) improvement. Do you have ideas for particular images or animals that you would like to see in the game? Email <a href="info@flyingsoftgames.com">info@flyingsoftgames.com</a> with your ideas on images, and you will be manually credited 5-10 gems! </p>', '<p> Press the letter in the top-right (currently either "P" or "A" as of this writing) to switch between different image categories! </p>', "<p> If you haven't tried it yet, consider playing a Hard or Insane puzzle. Yeah. See you in an hour. </p>", "<p> You know what makes a great birthday present?... Yeah, I went there. </p>", '<p> While playing a game, check out "About and Credit List" in the main menu, and then select "Next >" to see the credits for a particular image. </p>', '<p> If you select "Ogle Trophies" in the main menu, you will see a list of the trophies achieved so far. </p>', '<p> Try playing with the Categories feature. Just toggle "Categories Disabled" to "Categories Enabled" in the main menu and you will see a categories ribbon appear while inside a puzzle screen... </p>', '<p> Questions, comments, suggestions? Email <a href="info@flyingsoftgames.com">info@flyingsoftgames.com</a> with the details! Send your message in any language -- we (I) can translate particularly better if you use French, Spanish, or Russian. Purveyors of interesting comments will receive 5-10 gems. </p>']
 }

